// OTPVerification.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

// Configure axios defaults
axios.defaults.withCredentials = true;

// Add request/response interceptors for debugging
axios.interceptors.request.use(
  config => {
    console.log('ðŸš€ Request:', config.method.toUpperCase(), config.url);
    console.log('Request data:', config.data);
    console.log('Request headers:', config.headers);
    return config;
  },
  error => {
    console.error('âŒ Request Error:', error);
    return Promise.reject(error);
  }
);

axios.interceptors.response.use(
  response => {
    console.log('âœ… Response:', response.status, response.statusText);
    console.log('Response data:', response.data);
    return response;
  },
  error => {
    if (error.response) {
      console.error('âŒ Response Error:', error.response.status, error.response.statusText);
      console.error('Response data:', error.response.data);
    } else if (error.request) {
      console.error('âŒ No Response Received:', error.request);
    } else {
      console.error('âŒ Error:', error.message);
    }
    return Promise.reject(error);
  }
);

const OTPVerification = ({ clientId, onSuccess, onBackToLogin }) => {
  const [otp, setOtp] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [effectiveClientId, setEffectiveClientId] = useState('');
  const [debugInfo, setDebugInfo] = useState(null);

  // Get the client ID from localStorage if not passed in props
  useEffect(() => {
    // First check props
    if (clientId) {
      setEffectiveClientId(clientId);
      console.log("Using clientId from props:", clientId);
    } else {
      // Then try localStorage
      const storedClientId = localStorage.getItem('clientId');
      if (storedClientId) {
        setEffectiveClientId(storedClientId);
        console.log("Using clientId from localStorage:", storedClientId);
      } else {
        // Display an error that no client ID is available
        setError('No client ID found. Please go back to the login page.');
        console.error("No client ID available from props or localStorage");
      }
    }
  }, [clientId]);

  // Function to fetch debug data
  const fetchDebugInfo = async () => {
    try {
      const response = await axios.get('http://localhost:5000/debug/api-log');
      setDebugInfo(response.data);
    } catch (error) {
      console.error('Error fetching debug info:', error);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Guard against missing clientId
    if (!effectiveClientId) {
      setError('No client ID available. Please return to login.');
      return;
    }

    setLoading(true);
    setError('');

    try {
      console.log('Verifying OTP for client:', effectiveClientId);

      // Always include client_id in the request body
      const response = await axios.post('http://localhost:5000/api/verify-otp', {
        otp,
        client_id: effectiveClientId
      });

      if (response.data.status === 'SUCCESS') {
        // Clear any stored client ID
        localStorage.removeItem('clientId');
        onSuccess(response.data);
      } else {
        setError(response.data.message || 'Verification failed');
      }
    } catch (error) {
      console.error('Error verifying OTP:', error);

      if (error.response) {
        // The request was made and the server responded with a status code
        // that falls out of the range of 2xx
        setError(error.response.data.message || 'Server error during verification');
      } else if (error.request) {
        // The request was made but no response was received
        setError('Could not connect to server. Please check if the server is running.');
      } else {
        // Something happened in setting up the request that triggered an Error
        setError('Error during verification: ' + error.message);
      }
    } finally {
      setLoading(false);
      // Fetch updated debug info after the operation
      fetchDebugInfo();
    }
  };

  const handleResendOTP = async () => {
    // Guard against missing clientId
    if (!effectiveClientId) {
      setError('No client ID available. Please return to login.');
      return;
    }

    setLoading(true);
    setError('');

    try {
      console.log('Resending OTP for client:', effectiveClientId);

      // Always include client_id in the request body
      const response = await axios.post('http://localhost:5000/api/resend-otp', {
        client_id: effectiveClientId
      });

      if (response.data.status === 'SUCCESS') {
        alert('OTP resent successfully!');
      } else {
        setError(response.data.message || 'Failed to resend OTP');
      }
    } catch (error) {
      console.error('Error resending OTP:', error);

      if (error.response) {
        setError(error.response.data.message || 'Server error while resending OTP');
      } else if (error.request) {
        setError('Could not connect to server. Please check if the server is running.');
      } else {
        setError('Error resending OTP: ' + error.message);
      }
    } finally {
      setLoading(false);
      // Fetch updated debug info after the operation
      fetchDebugInfo();
    }
  };

  // Fetch debug info when component mounts
  useEffect(() => {
    fetchDebugInfo();
  }, []);

  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="card">
            <div className="card-header">
              <h3 className="text-center">OTP Verification</h3>
              {effectiveClientId && (
                <p className="text-center text-muted">Client ID: {effectiveClientId}</p>
              )}
            </div>
            <div className="card-body">
              {error && (
                <div className="alert alert-danger" role="alert">
                  {error}
                </div>
              )}
              <form onSubmit={handleSubmit}>
                <div className="form-group mb-3">
                  <label htmlFor="otp">Enter OTP sent to your registered mobile/email</label>
                  <input
                    type="text"
                    className="form-control"
                    id="otp"
                    value={otp}
                    onChange={(e) => setOtp(e.target.value)}
                    placeholder="Enter OTP"
                    disabled={loading || !effectiveClientId}
                    required
                  />
                </div>
                <div className="d-grid gap-2">
                  <button
                    type="submit"
                    className="btn btn-primary"
                    disabled={loading || !otp || !effectiveClientId}
                  >
                    {loading ? 'Verifying...' : 'Verify OTP'}
                  </button>
                  <button
                    type="button"
                    className="btn btn-secondary"
                    onClick={handleResendOTP}
                    disabled={loading || !effectiveClientId}
                  >
                    Resend OTP
                  </button>
                  {onBackToLogin && (
                    <button
                      type="button"
                      className="btn btn-link"
                      onClick={onBackToLogin}
                      disabled={loading}
                    >
                      Back to Login
                    </button>
                  )}
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>

      {/* Debug Information Panel */}
      <div className="row mt-4">
        <div className="col-12">
          <div className="card">
            <div className="card-header d-flex justify-content-between align-items-center">
              <h4>API Interactions Debug</h4>
              <button className="btn btn-sm btn-info" onClick={fetchDebugInfo}>
                Refresh Debug Info
              </button>
            </div>
            <div className="card-body">
              <div className="debug-info" style={{ maxHeight: '400px', overflow: 'auto' }}>
                {debugInfo ? (
                  <table className="table table-sm table-striped">
                    <thead>
                      <tr>
                        <th>Timestamp</th>
                        <th>Direction</th>
                        <th>Endpoint</th>
                        <th>Data</th>
                      </tr>
                    </thead>
                    <tbody>
                      {debugInfo.map((item, index) => (
                        <tr key={index}>
                          <td>{item.timestamp}</td>
                          <td>
                            {item.direction.includes('REQUEST') ? (
                              <span className="badge bg-primary">REQUEST</span>
                            ) : (
                              <span className="badge bg-success">RESPONSE</span>
                            )}
                          </td>
                          <td>{item.endpoint}</td>
                          <td>
                            <pre style={{ maxHeight: '100px', overflow: 'auto' }}>
                              {JSON.stringify(item.data, null, 2)}
                            </pre>
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                ) : (
                  <p>Loading debug information...</p>
                )}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default OTPVerification;
